description:
Never Come Back

Sociopolitical Documentary hosted by Malcolm Hamilton, published by OMNI TV in 2011 - English narration


Information
------------------------------

Never Come Back tells the story of the Roma (or 'Gypsy) community in Canada. Characters include Tibor Lukacs, from the Czech Republic, who founded a mostly-Roma soccer team in Hamilton, Ontario; and Tamas Banya, a folk musician from Budapest, who is still seeking refugee status in Canada. After accepting many Roma refugees from central Europe, Canada shifted course and now refuses most Roma who claim they have fled persecution and violence. The film travels to Hungary and the Czech Republic to test the Canadian government's current claim that these are democratic countries that respect and protect Roma human rights.

